import styles from "../assets/FooterLandingPage.module.css"

function FooterLandingPage() {
  return (
    <div className={styles.footerContainer}>
     <a href="http://localhost:3000" className="fa fa-spotify fa-3x" target="_blank" rel="noreferrer"> </a>
     <a href="http://localhost:3000" className="fa fa-instagram fa-3x" target="_blank" rel="noreferrer"> </a>
     <a href="http://localhost:3000" className="fa fa-twitter fa-3x" target="_blank" rel="noreferrer"> </a>
     <a href="http://localhost:3000" className="fa fa-youtube fa-3x" target="_blank" rel="noreferrer"> </a>
    </div>
  );
}

export default FooterLandingPage;
